<style>
#topHeader {
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 60px;
    background: #000000dd;
    backdrop-filter: blur(6px);
    display: flex;
    justify-content: space-between;
    align-items: center;
    padding: 0 18px;
    box-sizing: border-box;
    z-index: 9999;
    border-bottom: 1px solid #222;
}

#topHeader .appName {
    font-size: 20px;
    font-weight: bold;
    color: #00eaff;
}

#topHeader .contactBtn {
    background: #00eaff;
    color: #000;
    padding: 8px 14px;
    border-radius: 8px;
    font-size: 14px;
    font-weight: bold;
    cursor: pointer;
    text-decoration: none;
}

/* BODY */
body {
    margin: 0;
    font-family: "Segoe UI", sans-serif;
    background: #0f0f0f;
    color: #fff;
    display: flex;
    justify-content: center;
    align-items: center;
    height: 100vh;
    overflow: hidden;
}

/* PAGE WRAPPERS */
#loaderPage, #cardsPage {
    position: absolute;
    width: 100%;
    height: 100%;
    display: none;
    justify-content: center;
    align-items: center;
    flex-direction: column;
    padding: 20px;
    opacity: 0;
    transition: opacity 0.8s ease;
}

#loaderPage { display: flex; background: #000; opacity: 1; }

/* SPINNER */
.spinner {
    width: 120px;
    height: 120px;
    border-radius: 50%;
    border: 10px solid rgba(255,255,255,0.1);
    border-top: 10px solid #00eaff;
    animation: spin 1s linear infinite;
}
@keyframes spin { to { transform: rotate(360deg); } }

/* CARDS PAGE */
#cardsPage {
    background: #111;
    display: flex;
    flex-direction: column;
    height: 100%;
    overflow: hidden;
}

#cardsScrollArea {
    margin-top: 60px !important;
    flex: 1;
    width: 100%;
    overflow-y: auto;
}

#WaitMessage {
    position: sticky;
    bottom: 0;
    text-align: center;
    padding: 18px 12px;
    font-size: 15px;
    color: #bbbbbb;
    opacity: 0;
    transition: opacity 0.8s ease;
}

@keyframes fadeIn {
    from { opacity: 0; transform: translateY(15px); }
    to   { opacity: 1; transform: translateY(0); }
}

.card a {
    color: #00eaff;
    text-decoration: none;
}

#hourglass {
    animation: rotatePause 1.5s linear infinite;
}
@keyframes rotatePause {
    0% { transform: rotate(0deg); }
    66% { transform: rotate(360deg); }
    100% { transform: rotate(360deg); }
}
</style>
</head>
